// Отримати цифри з рядка
function getDigFromString(item) {
  return parseInt(item.replace(/[^\d]/g, ""));
}
// Форматування цифр типу 100 000 000
function getDigFormat(item) {
  return item.toString().replace(/(\d)(?=(\d\d\d)+([^\d]|$))/g, "$1 ");
}
